    public static long add(long x, long y) {
        return x + y;
    }

    public static long sub(long x, long y) {
        return x - y;
    }

    public static long mul(long x, long y) {
        return (x * y) >> SCALE;
    }

    public static long div(long x, long y) {
        long sign = (x < 0) ^ (y < 0) ? -1 : 1;
        long result = (Math.abs(x) << SCALE) / Math.abs(y);

        return sign * result;
    }

    public static long sqrt(long x) {
        if (x < 0) {
            throw new IllegalArgumentException("음수의 제곱근은 계산할 수 없습니다.");
        }
        if (x == 0) {
            return 0;
        }

        long root = 0;
        long remainder = x;
        long place = 1L << 62; // 64비트 정수의 제곱근은 32비트를 넘지 않음

        while (place > remainder) {
            place >>= 2;
        }

        while (place != 0) {
            if (remainder >= root + place) {
                remainder -= root + place;
                root += place << 1;
            }
            root >>= 1;
            place >>= 2;
        }

        // root는 이제 n의 '정수' 제곱근입니다.
        // 이를 Q48.16 형식으로 변환해야 합니다.
        // 수학적 결과는 Q56.8 형식이므로, 8비트 왼쪽 시프트하여 Q48.16으로 맞춰줍니다.
        return root << HALF_SCALE;
    }

    public static long sin(long degrees) {
        while (degrees > 360L << SCALE) {
            degrees -= 360L << SCALE;
        }
        while (degrees < 0L) {
            degrees += 360L << SCALE;
        }

        int index = (int)(mul(div(degrees, 360L << SCALE), (SIN.length - 1) << SCALE) >> SCALE);
        return SIN[index];
    }
    public static long cos(long degrees) {
        while (degrees > 360 << SCALE) {
            degrees -= 360 << SCALE;
        }
        while (degrees < 0) {
            degrees += 360 << SCALE;
        }

        int index = (int)(mul(div(degrees, 360 << SCALE), (COS.length - 1) << SCALE) >> SCALE);
        return COS[index];
    }
    public static long tan(long degrees) {
        while (degrees > 360 << SCALE) {
            degrees -= 360 << SCALE;
        }
        while (degrees < 0) {
            degrees += 360 << SCALE;
        }

        int index = (int)(mul(div(degrees, 360 << SCALE), (TAN.length - 1) << SCALE) >> SCALE);
        return TAN[index];
    }
    // 출력 각도값 degrees임 radians 아님에 주의
    public static long atan2(long y, long x) {
        long absY = Math.abs(y);
        long absX = Math.abs(x);

        long tan;

        if (absY <= absX) {
            tan = div(absY, absX);
        } else {
            tan = div(absX, absY);
        }

        long atan = atan(tan);

        long angle;
        if (x >= 0 && y >= 0) {//1사분면
            if (absY <= absX) {
                angle = atan;
            } else {
                angle = (90L << SCALE) - atan;
            }
        } else if (x < 0 && y >= 0) {//2사분면
            if (absY <= absX) {
                angle = (180L << SCALE) - atan;
            } else {
                angle = (90L << SCALE) + atan;
            }

        } else if (x < 0) {//3사분면
            if (absY <= absX) {
                angle = (180L << SCALE) + atan;
            } else {
                angle = (270L << SCALE) - atan;
            }

        } else {//4사분면
            if (absY <= absX) {
                angle = (360L << SCALE) - atan;
            } else {
                angle = (270L << SCALE) + atan;
            }
        }

        return angle;
    }

    public static long fromLong(long value) {
        if (value >= 0) {
            return value << SCALE;
        } else {
            return -(-value << SCALE);
        }
    }

    public static long fromDouble(double value) {
        return (long) (value * ONE);
    }

    public static double toDouble(long value) {
        return ((double) value) / ONE;
    }


    // 출력 각도값 degrees임 radians 아님에 주의
    private static long atan(long tan) {
        if (tan < 0 || tan > ONE) {
            throw new RangeException(RangeException.BAD_BOUNDARYPOINTS_ERR, "0~45도까지의 탄젠트값 즉 0~ONE까지만 받음");
        }

        // tan값을 ATAN의 길이와 곱하여 인덱스 값으로 변환
        int index = (int) (mul(tan, (ATAN.length - 1) << SCALE) >> SCALE);

        return ATAN[index];
    }

